import React, { useState, useEffect } from "react";
import { Line } from "react-chartjs-2";
import axios from "axios";
import { useLocation } from "react-router-dom";
import Navbar from "../homepage/Navbar";

import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
} from "chart.js";

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

const API_URL = "http://127.0.0.1:8000/api/resale/";

export default function HDBResaleVisualizer() {
  const location = useLocation();
  const {
    selectedDistricts = [],
    selectedRoomType = "",
    selectedDistrict = "",
    selectedRoomTypes = [],
    type = "multi-district"
  } = location.state || {};

  const [chartData, setChartData] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    if (type === "multi-district" && selectedDistricts.length && selectedRoomType) {
      fetchMultiDistrictData("price_trends");
    } else if (type === "single-district" && selectedDistrict && selectedRoomTypes.length) {
      fetchSingleDistrictData("price_trends");
    }
  }, [selectedDistricts, selectedRoomType, selectedDistrict, selectedRoomTypes]);

  const fetchMultiDistrictData = (analysisType) => {
    setLoading(true);
    setError(null);

    const queryParams = new URLSearchParams();
    selectedDistricts.forEach((town) => queryParams.append("towns", town));
    queryParams.append("room_type", selectedRoomType);
    queryParams.append("type", analysisType);

    axios
      .get(`${API_URL}resale_analysis/?${queryParams.toString()}`)
      .then((res) => processChartData(res.data, selectedDistricts, "town"))
      .catch((err) => handleError(err))
      .finally(() => setLoading(false));
  };

  const fetchSingleDistrictData = (analysisType) => {
    setLoading(true);
    setError(null);

    const queryParams = new URLSearchParams();
    queryParams.append("towns", selectedDistrict);
    queryParams.append("type", analysisType);

    axios
      .get(`${API_URL}resale_analysis/?${queryParams.toString()}`)
      .then((res) => processChartData(res.data, selectedRoomTypes, "flat_type"))
      .catch((err) => handleError(err))
      .finally(() => setLoading(false));
  };

  const processChartData = (data, categoryList, categoryKey) => {
    if (!data.length) {
      setError("No data found for the selected criteria.");
      return;
    }

    const uniqueYears = [...new Set(data.map((d) => Number(d.year)))].sort();

    const processedData = {
      labels: uniqueYears,
      datasets: categoryList.map((category) => {
        const filtered = data
          .filter((d) => d[categoryKey].toUpperCase() === category.toUpperCase())
          .sort((a, b) => Number(a.year) - Number(b.year));

        return {
          label: category,
          data: uniqueYears.map((year) => {
            const match = filtered.find((d) => Number(d.year) === Number(year));
            return match ? parseFloat(match.resale_price) : null;
          }),
          borderColor: `#${Math.floor(Math.random() * 16777215).toString(16)}`,
          fill: false,
          tension: 0.1,
        };
      }),
    };

    setChartData(processedData);
  };

  const handleError = (error) => {
    console.error("Error fetching data:", error);
    setError("Failed to fetch data. Please try again.");
  };

  const chartOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: "top",
        labels: {
          font: {
            size: 18,
            weight: "bold",
          },
        },
      },
      title: {
        display: true,
        text:
          type === "multi-district"
            ? "Compare Same Room Type in Multiple Districts"
            : `Compare Multiple Room Types in ${selectedDistrict}`,
        font: {
          size: 16,
        },
      },
    },
    scales: {
      x: {
        title: {
          display: true,
          text: "Year",
          font: {
            size: 16,
          },
        },
        type: "category",
      },
      y: {
        title: {
          display: true,
          text: "Resale Price (SGD)",
          font: {
            size: 16,
          },
        },
        beginAtZero: false,
      },
    },
  };

  return (
    <div className="min-h-screen bg-white text-red-900">
      <Navbar />
      <h1 className="text-3xl font-bold text-center mt-6">HDB Resale Price Visualizer</h1>

      <div className="w-3/4 mx-auto mt-3 p-4 bg-white rounded-lg shadow">
        {loading && <p className="text-blue-500 mt-4">Loading...</p>}
        {error && <p className="text-red-500 mt-4">{error}</p>}

        {chartData && (
          <div className="mt-1">
            <Line data={chartData} options={chartOptions} />
          </div>
        )}
      </div>
    </div>
  );
}
